h1 {
  margin: 0;
  font-size: 3em;
  font-weight: 900;
  line-height: 1.25em;
}

h2 {
  font-weight: 500;
}

p,
li {
  font-weight: 300;
  color: #aaa;
  font-size: 0.75em;
  line-height: 1.5em;
}

a {
  text-transform: uppercase;
  text-decoration: none;
  font-weight: 900;
  font-size: 0.75em;
  color: #6EC6B1;
  line-height: 1.5em;
  transition: 0.2s;
}
a:hover {
  transition: 0.2s;
  color: #49b89d;
}

.sprinkles-component {
  display: flex;
  flex-direction: column;
  padding: 0px;
  flex-direction: row;
  flex-flow: wrap;
}
.sprinkles-component .sprinkle-wrapper {
  display: flex;
  flex-direction: column;
  padding: 0px;
  justify-content: center;
  align-items: center;
}
.sprinkles-component .SVGInline,
.sprinkles-component .sprinkle-wrapper {
  transform-origin: center;
}
.sprinkles-component svg {
  transform: rotate(162deg);
}
